import React from 'react'

const Experience = (position1, position2) => {
  return (
    <div>
        <h2>Experiences</h2>
        <h3>{position2}</h3>
        <h4>* April 2016 – April 2022</h4>
        <h3>{position1}</h3>
        <h4>* April 2016 – April 202</h4>
    </div>
  )
}

export default Experience;
